import React from 'react';
import { StyleSheet, View, TouchableOpacity } from 'react-native';

import { Image } from 'react-native';

export default class Home extends React.Component {

  state = {
    icon_list : [],
  }

  componentDidMount()
  {


    let icon_list = [];
    for(let i=0; i<icons.length; ++i)
    {
      let item = {
        uri: "../images/"+icons[i],
        width: 64,
        height: 64
      }
      icon_list.push(item);
    }
    this.setState({ icon_list: icon_list}, function() {
      console.log("icon list updated");
    });

  }


   render() {

    const { icon_list } = this.state; 

    let icons = ["media.png", "notification.png", "papers.jpeg", "profile.png"];

      return (
          <View style = {styles.view}>

            {icon_list.map((item, i) => 
            {
              return (
                <TouchableOpacity onPress={() => console.log("click")} style = {styles.thumbnail} key={i} >
                  <Image style = {styles.thumbnail} source={require('../images/'+icons[i])} />
                </TouchableOpacity>
              );
            })}

          </View>

    );
  }
}

const logo = {
  uri: 'https://reactnative.dev/img/tiny_logo.png',
  width: 64,
  height: 64
};

var styles = StyleSheet.create({

  view: {
    //alignContent: 'flex-start',
    alignItems: 'center',
    display: 'flex',
    flexDirection: 'row',
    flexWrap: 'wrap',
    height: '100%',
    justifyContent: 'center'
   //position: "absolute"
  },
  thumbnail: {
    margin: 10,
    width: 100,
    height: 100,
  },
 });
